Male genitalia:
Pygofer about twice as long as greatest width, moderately projected posteriorly, apex widey rounded; macrosetae long, dispersed along apical half (
Fig. 34a
). Valve ovate, margins rounded in anterior half, slightly curved. Plates long, apex pointed, with a few clusters of plumose setae at apex (
Fig. 34b
). Style with apophysis short, striate, curved and truncate (
Fig. 34c
). In ventral view aedeagus with wide base and straight sides; shaft with wide base, tapered, curved dorsad then in last third slightly curved caudad, apex truncate, slightly longer than ventral processes (
Fig. 34d
). Ventral processes arising a third of the way along the aedeagus, widely divergent, apices tapered and pointed, serrate. In lateral view shaft S-shaped, curved caudad, tapered, truncate at apex; dorsal projection slender, straight, apex pointed. Gonopore apical. Ventral processes separated from shaft at base, curved slightly dorsad, apices pointed (
Fig. 34e
).
